import './User.css';
import Card from "react-bootstrap/Card";
import funny from "../../Img/IamRich.png"

function User() {
  return (
    <div className="User">
      <h1>User </h1>

      <div className='Card'>
        <img src={funny} alt="Avatar" style={{width:"100px" }}/>
        <div className=''></div>


      </div>
    </div>
  );
}

export default User;
